height":420,"width":420}},"output_type":"display_data"}],"source":["# Visualising the Training set results\n","library(Rfast)\n","set = train_set\n","X1 = seq(min(set[, 1]) - 1, max(set[, 1]) + 1, by = 0.01)\n","X2 = seq(min(set[, 2]) - 1, max(set[, 2]) + 1, by = 0.01)\n","grid_set = expand.grid(X1, X2)\n","colnames(grid_set) = c('Age', 'EstimatedSalary')\n","y_grid = predict(classifier, newdata = grid_set)\n","plot(set[, -3],\n","     main = 'SVM Linear Kernel (Train set)',\n","     xlab = 'Age', ylab = 'Estimated Salary',\n","     xlim = range(X1), ylim = range(X2))\n","contour(X1, X2, matrix(as.numeric(y_grid), length(X1), length(X2)), add = TRUE)\n","points(grid_set, pch = '.', col = ifelse(y_grid == 1, 'springgreen3', 'tomato'))\n","points(set, pch = 21, bg = ifelse(set[, 3] == 1, 'green4', 'red3'))"]},{"cell_type":"code","execution_count":12,"id":"ec470e75","metadata":{"execution":{"iopub.execute_input":"2022-03-15T12:32:50.667252Z","iopub.status.busy":"2022-03-15T12:32:50.665884Z","iopub.status.idle":"2022-03-15T12:32:55.79688Z","shell.execute_reply":"2022-03-15T12:32:55.796331Z"},"papermill":{"duration":5.242188,"end_time":"2022-03-15T12:32:55.797025","exception":false,"start_time":"2022-03-15T12:32:50.554837","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ2BUVd7H8d+dSa8QCBBa6B2kSBGkihQVBMEKip21YG+rrqKujyz2hgq6Cth2\nLayogAjSlKKi9CItlNACaaQnM/d5MUkIJBMmbSYz+X5eTc45c+Y/k5D8OPfecw3TNAUAAADv\nZ/F0AQAAAKgcBDsAAAAfQbADAADwEQQ7AAAAH0GwAwAA8BEEOwAAAB9BsAMAAPARBDsAAAAf\nQbADAADwEQQ7AAAAH0GwAwAA8BEEOwAAAB9BsAMAAPARBDsAAAAfQbADAADwEQQ7AAAAH0Gw\nAwAA8BEEOwAAAB9BsAMAAPARBDsAAAAfQbADAADwEQQ7AAAAH0GwAwAA8BEEOwAAAB9BsAMA\nAPARBDsAAAAfQbADAADwEQQ7AAAAH0GwAwAA8BEEOwAAAB9BsAMAAPARBDsAAAAfQbADAADw\nEQQ7AAAAH0GwAwAA8BEEOwAAAB9BsAMAAPARBDsAAAAfQbADAADwEQQ7oKLyMvd//NoTYy7u\nFxsTHRrkFxQa2TC23cVjJrw8+/sUm1k4LHnXU0aBwR/vLj6PPe9knQCrY0BM39mSDv4wzDjT\nW4fTznrWNwMbnTUm2yw+d8FL5B4tHN